import React, { useEffect, useState } from 'react';
import { useHistory, useParams } from 'react-router-dom';
import { fetchCountryMedals } from '../api/countryAPI';
import { Container, Col, Card, Button, Row } from 'react-bootstrap';
import { COUNTRIES_ROUTE } from '../utils/consts';

const CountryPage = () => {
    const [country, setCountry] = useState(null);
    const { name } = useParams();
    const history = useHistory();

    const containerStyle = {
        position: 'relative',
        backgroundImage: 'url(/images/bg.png)',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        padding: '0px',  
        height: '100vh' ,
        width: '100vw',
        color:"white"
    };

    const imgStyle = {
        display: 'block',
    };

    const i = {
        color: "white",
        border: '3px solid white',
        width: '300px',
        height:'60px',
        margin: '10px',
        borderRadius: '20px',
        backgroundColor:"rgba(255, 255, 255, 0.29)",
        cursor: "pointer",
    };

    const prev = {
        ...imgStyle,
        top: '15px',
        left: '10px',
        margin:"30px"
    };

    const logo = {
        ...imgStyle,
        top: '15px',
        left: '150px',
        margin:"15px",
        marginLeft:"71px",
        height:"57px",
    };

    const flag = {
        marginLeft:"135px",
    };

    const h1 = {
        color:"white",
        textAlign:"center",
    }
    const table = {
        display: 'flex',
        flexDirection: 'column', // Убедитесь, что строки располагаются вертикально
        justifyContent: 'center',
        alignItems: 'center',
        marginTop: '20px',
        width: '100%',
    };

    const tableRow = {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        width: '100%',
    };

    const tableChild1 = {
        padding:"0px 5px 20px 5px",
        textAlign: 'center',
        border: "1px solid white",
        borderTop:"0px",
        margin:"0px",
    };

    const g = {
        padding:"20px 22.39px 0px 20.485px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom:"0px",
    }

    const s = {
        padding:"20px 20.485px 0px 20.485px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom:"0px",
    }

    const b = {
        padding:"20px 20.485px 0px 20.485px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom:"0px",
    }

    const t = {
        padding:"20px 20.485px 0px 20.485px",
        textAlign: 'center',
        border: "1px solid white",
        borderBottom:"0px",
    }



    useEffect(() => {
        fetchCountryMedals(name)
            .then(data => setCountry(data))
            .catch(error => console.error(error));
    }, [name]);

    const handleMedalClick = (medalType) => {
        history.push(`/medals/${medalType}`);
    };

    if (!country) {
        return <div>Loading...</div>;
    }

    return (
        <Container style={containerStyle}>
            <Row >
                <img style={prev} src='/images/ico-prev.svg' alt='paris' onClick={() => history.push(COUNTRIES_ROUTE)} />
                <img style={logo} src='/images/logo-sm-white.png' alt='paris' />
            </Row>
            <Col className='p-0'>
            <h1 style={h1}>{country.name}</h1>
            <img style={flag} src={`/images/flags/${country.name.replace(' ', '')}.png`} alt={country.name} />
            </Col>
            <Col style={table}>
                <Row style={tableRow}>
                    <h5 style={tableChild1}>GOLD</h5>
                    <h5 style={tableChild1}>SILVER</h5>
                    <h5 style={tableChild1}>BRONZE</h5>
                    <h5 style={tableChild1}>TOTAL</h5>
                </Row >
                <Row style={tableRow}>
                    <h5 style={g}>{country.medals.gold}</h5>
                    <h5 style={s}>{country.medals.silver}</h5>
                    <h5 style={b}>{country.medals.bronze}</h5>
                    <h5 style={t}>{country.medals.gold + country.medals.silver + country.medals.bronze}</h5>
                </Row >
            </Col>


            <Col>
                    <Card className="d-flex flex-column align-items-center justify-content-around" style={i}>
                        <h5>Золото: {country.medals.gold}</h5>
                        <Button variant={"outline-gold"} onClick={() => handleMedalClick('gold')}>Перейти</Button>
                    </Card>
                <Col md={4}>
                    <Card className="d-flex flex-column align-items-center justify-content-around" style={i}>
                        <h5>Серебро: {country.medals.silver}</h5>
                        <Button variant={"outline-silver"} onClick={() => handleMedalClick('silver')}>Перейти</Button>
                    </Card>
                </Col>
                <Col md={4}>
                    <Card className="d-flex flex-column align-items-center justify-content-around" style={i}>
                        <h5>Бронза: {country.medals.bronze}</h5>
                        <Button variant={"outline-bronze"} onClick={() => handleMedalClick('bronze')}>Перейти</Button>
                    </Card>
                </Col>
            </Col>
            <h5>Общее количество медалей: {country.medals.gold + country.medals.silver + country.medals.bronze}</h5>
        </Container>
    );
};

export default CountryPage;
